INSERT INTO `tkonten` (`id`, `page`, `konten`) VALUES
(1, 'home', '<p style="padding-left: 30px;"><span style="font-size: medium; color: #000000;"><span style="font-family: ''Century Gothic'', serif;">Biodiversity is the main elements of an ecosystem, basis of support system for human life. Ecosystem provide natural resources such as food, medecine, wood, textile, regulate climatic processes, breakdown waste and recycling nutrients, filter and purify water, buffer against flooding, maintain soil fertility, and purify air.</span></span></p>\r\n<p style="padding-left: 30px;"><span style="font-size: medium; color: #000000;"><span style="font-family: ''Century Gothic'', serif;">Designated protected area provide habitat only for a litle part of biodiversity and the most live in used lands where will be converted. Yasiwa cooperate with stakeholders to use natural landscape with responsibility to maintain biodiversity velues and ecological services by setting aside natural habitat for future common benefits.</span></span></p>');
INSERT INTO `tkonten` (`id`, `page`, `konten`) VALUES
(3, 'aboutus', '<p style="text-align: justify; padding-left: 30px;"><span style="font-size: medium;"><span style="color: #4f81bd;"><span style="font-family: ''Century Gothic'', serif;">Yayasan Konservasi Khatulistiwa Indonesia, YASIWA, is a charitabe, not-for-profit foundation launched in June 2012 to encourage and support conservation management and design conservation policies for and appripriate to mixed-use lansdcapes</span></span><span style="font-family: ''Century Gothic'', serif;">. </span></span></p>\r\n<p style="text-align: justify; padding-left: 30px;"><span style="font-size: medium;"><span style="color: #4f81bd;"><span style="font-family: ''Century Gothic'', serif;">Vision</span></span></span></p>\r\n<p style="text-align: justify; padding-left: 30px;"><span style="font-size: medium;"><span style="color: #4f81bd;"><span style="font-family: ''Century Gothic'', serif;">Maintain biodiversity within mixed-use landscapes</span></span></span></p>\r\n<p style="text-align: justify; padding-left: 30px;"><span style="font-size: medium;"><span style="color: #4f81bd;"><span style="font-family: ''Century Gothic'', serif;">Mision</span></span></span></p>\r\n<ul style="list-style-type: square;">\r\n<li style="padding-left: 30px;"><span style="font-size: medium;"><span style="color: #4f81bd;"><span style="font-family: ''Century Gothic'', serif;">Promote understanding of ecologies that are strongly evidence based, as a base to develop strategies for conservation management of species outside protected areas.</span></span></span></li>\r\n<li style="padding-left: 30px;"><span style="font-size: medium;"><span style="color: #4f81bd;"><span style="font-family: ''Century Gothic'', serif;">Develop partnership with various parties to support and cooperate in gathering different aspects of knowledge on how to manage mixed use landscapes.</span></span></span></li>\r\n<li style="padding-left: 30px;"><span style="font-size: medium;"><span style="color: #4f81bd;"><span style="font-family: ''Century Gothic'', serif;">Develope learning and training source of practical conservation. </span></span></span></li>\r\n</ul>\r\n<p><img style="display: block; margin-left: auto; margin-right: auto;" src="data:image/jpeg;base64," alt="" width="624" height="468" name="Picture 1" align="bottom" border="0" /></p>');
INSERT INTO `tkonten` (`id`, `page`, `konten`) VALUES
(6, 'hww', '<p><span style="font-size: medium; color: #000000;"><span style="font-family: ''Century Gothic'', serif;">Scope of work:</span></span></p>\r\n<p><span style="font-size: medium; color: #000000;"><span style="font-family: ''Century Gothic'', serif;">Systematic field inventories of flora and fauna and establish a permanent record of species identities, distribution, national protection, IUCN (International Union for Conservation of Nature) Red list and CITES (Convention on International Trade in Endangered Species) status, time and locations for all species observed;</span></span></p>\r\n<p><span style="font-size: medium; color: #000000;"><span style="font-family: ''Century Gothic'', serif;">Identify, design and provide assistance in sustainable area management, through species management, enrichment and restoration of habitats by planting of local trees, fruit trees and other valuable flora;</span></span></p>\r\n<p><span style="font-size: medium; color: #000000;"><span style="font-family: ''Century Gothic'', serif;">Develop resources for learning and training in practical conservation management for the public and the private sector. Practical conservation programs are offered to companies by transferring knowledge and conservation programe, which is well integrated into the company&rsquo;s operational activities as well as communicate with the local communities on the changes of their traditional livelihoods;</span> </span></p>\r\n<p><span style="color: #000000;"><a style="color: #000000;" name="_GoBack"></a> <span style="font-size: medium;"><span style="font-family: ''Century Gothic'', serif;">Communicate and collaborate with government, education, and science institutions, as well as local communities and companies to achieve understanding and a common strategy to manage conservation sustainably. </span></span></span></p>\r\n<p><span style="font-size: medium; color: #000000;"><span style="font-family: ''Century Gothic'', serif;">Kemitraan</span></span></p>\r\n<table style="margin-left: auto; margin-right: auto;" width="555" cellspacing="0" cellpadding="7">\r\n<tbody>\r\n<tr>\r\n<td style="width: 106px;" height="30">\r\n<p style="text-align: center;" align="center"><span style="color: #365f91;"><img src="data:image/jpeg;base64," alt="" width="58" height="71" name="Picture 2" align="bottom" border="0" vspace="1" /> </span></p>\r\n</td>\r\n<td style="width: 415px;" valign="top">\r\n<p><span style="color: #365f91;"><span style="font-family: ''Century Gothic'', serif;">MoU dengan Pemerintah Provinsi Kalimantan Timur untuk penelitian dan pengembangan konservasi di Kalimantan Timur, implementasi melalui kerja sama teknis dengan UPTD PPA untuk melakukan identifikasi kawasan bernilai konservasi tinggi.</span></span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n<tbody>\r\n<tr>\r\n<td style="width: 106px;" bgcolor="#d3dfee" height="31">\r\n<p align="center">&nbsp;</p>\r\n<p align="center"><span style="color: #365f91;"><img src="data:image/png;base64," alt="" width="60" height="60" name="Picture 3" align="bottom" border="0" /> </span></p>\r\n<p align="center">&nbsp;</p>\r\n</td>\r\n<td style="width: 415px;" valign="top" bgcolor="#d3dfee">\r\n<p>&nbsp;</p>\r\n<p><span style="color: #365f91;"><span style="font-family: ''Century Gothic'', serif;">MoU dengan Universitas Mulawarman untuk kegiatan penelitian dan pengembangan di bidang konservasi keragaman hayati dan ekosistemnya.</span></span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 106px;" height="34">\r\n<p align="center"><span style="color: #365f91;"><img src="data:image/jpeg;base64," alt="" width="68" height="71" name="Picture 4" align="bottom" border="0" vspace="1" /> </span></p>\r\n</td>\r\n<td style="width: 415px;" valign="top">\r\n<p>&nbsp;</p>\r\n<p><span style="color: #365f91;"><span style="font-family: ''Century Gothic'', serif;">Kerja sama dalam kegiatan survei keragman hayati untuk pengembangan program konservasi di wilayah kerja PT HIP di Kabupaten Sorong, Papua Barat</span></span></p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 106px;" bgcolor="#d3dfee" height="31">\r\n<p align="center"><span style="color: #365f91;"><img src="data:image/jpeg;base64," alt="" width="69" height="66" name="Picture 6" align="bottom" border="0" hspace="1" vspace="1" /> </span></p>\r\n</td>\r\n<td style="width: 415px;" valign="top" bgcolor="#d3dfee">\r\n<p>&nbsp;</p>\r\n<p><span style="color: #365f91;"><span style="font-family: ''Century Gothic'', serif;">Kerja sama dalam kegiatan survei keragman hayati untuk pengembangan program konservasi di wilayah kerja PT Pusaka Agro Lestari di Kabupaten Mimika, Papua</span></span></p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 106px;" height="31">\r\n<p align="center"><span style="color: #365f91;"><img src="data:image/jpeg;base64," alt="" width="105" height="51" name="Picture 7" align="bottom" border="0" vspace="1" /> </span></p>\r\n</td>\r\n<td style="width: 415px;" valign="top">\r\n<p>&nbsp;</p>\r\n<p><span style="color: #365f91;"><span style="font-family: ''Century Gothic'', serif;">Kerja sama untuk pengembangan konservasi praktis di lingkungan perkebunan sawit </span></span></p>\r\n<p>&nbsp;</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 106px;" bgcolor="#d3dfee" height="31">\r\n<p align="center"><span style="color: #365f91;"><img src="data:image/jpeg;base64," alt="" width="73" height="67" name="Picture 8" align="bottom" border="0" /> </span></p>\r\n</td>\r\n<td style="width: 415px;" valign="top" bgcolor="#d3dfee">\r\n<p>&nbsp;</p>\r\n<p><span style="color: #365f91;"><span style="font-family: ''Century Gothic'', serif;">Kerja sama untuk rehabilitasi rawa dan penerapan agroforestri</span></span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 106px;" height="31">\r\n<p align="center"><span style="color: #365f91;"><img src="data:image/jpeg;base64," alt="" width="64" height="82" name="Picture 9" align="bottom" border="0" hspace="1" /> </span></p>\r\n</td>\r\n<td style="width: 415px;" valign="top">\r\n<p>&nbsp;</p>\r\n<p><span style="color: #365f91;"><span style="font-family: ''Century Gothic'', serif;">Donatur untuk kegiatan di lahan basah</span></span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 106px;" bgcolor="#d3dfee" height="31">\r\n<p>&nbsp;</p>\r\n<p align="center"><span style="color: #365f91;"><img src="data:image/jpeg;base64," alt="" width="83" height="48" name="Picture 10" align="bottom" border="0" /> </span></p>\r\n</td>\r\n<td style="width: 415px;" valign="top" bgcolor="#d3dfee">\r\n<p>&nbsp;</p>\r\n<p><span style="color: #365f91;"><span style="font-family: ''Century Gothic'', serif;">Donatur untuk kegiatan di lahan basah </span></span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 106px;" height="31">\r\n<p align="center">&nbsp;</p>\r\n<p align="center"><span style="color: #365f91;"><img src="data:image/jpeg;base64," alt="" width="63" height="60" name="Picture 11" align="bottom" border="0" /> </span></p>\r\n</td>\r\n<td style="width: 415px;" valign="top">\r\n<p>&nbsp;</p>\r\n<p><span style="color: #365f91;"><span style="font-family: ''Century Gothic'', serif;">Donatur untuk proyek konservasi buaya badas hitam di lahan basah Mesangat</span></span></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td style="width: 106px;" bgcolor="#d3dfee" height="30">\r\n<p align="center">&nbsp;</p>\r\n<p align="center"><span style="color: #365f91;"><img src="data:image/jpeg;base64," alt="" width="93" height="45" name="Picture 12" align="bottom" border="0" /> </span></p>\r\n<p align="center">&nbsp;</p>\r\n</td>\r\n<td style="width: 415px;" valign="top" bgcolor="#d3dfee">\r\n<p>&nbsp;</p>\r\n<p><span style="color: #365f91;"><span style="font-family: ''Century Gothic'', serif;">Kerja sama untuk jasa konsultansi pengembangan konservasi yang terintegrasi dalam pembangunan perkebunan</span></span></p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style="text-align: center;"><br /> </p>');

